DROP TABLE IF EXISTS `cg_form`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `cg_form` (
  `id` varchar(64) NOT NULL COMMENT 'ID',
  `name` varchar(45) NOT NULL COMMENT '名称',
  `path` varchar(200) NOT NULL DEFAULT 'record' COMMENT '路径',
  `table_id` varchar(32) NOT NULL COMMENT '对应表定义',
  `head_title` varchar(400) NOT NULL COMMENT 'form标题',
  `is_flow` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否流程定义',
  `icon` varchar(300) DEFAULT NULL COMMENT '图标',
  `tag_title` varchar(45) NOT NULL COMMENT 'tag标题',
  `label_position` varchar(45) NOT NULL DEFAULT 'top' COMMENT '字段标签位置',
  `is_dialog` tinyint(1) NOT NULL DEFAULT '0' COMMENT '对话框模式',
  `continue_add` tinyint(1) NOT NULL DEFAULT '1' COMMENT '连续编辑',
  `images` varchar(200) DEFAULT NULL COMMENT '顶部轮播图像',
  `view_properties` text COMMENT '视图属性',
  `form_properties` text COMMENT '表单属性',
  `slot_templates` text COMMENT 'slot模板',
  `action_list` varchar(200) DEFAULT NULL COMMENT '功能清单',
  PRIMARY KEY (`id`),
  UNIQUE KEY `ui_cg_form01` (`path`,`table_id`),
  KEY `fk_cg_form_table_id_cg_table_id` (`table_id`),
  CONSTRAINT `fk_cg_form_table_id_cg_table_id` FOREIGN KEY (`table_id`) REFERENCES `cg_table` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='表单定义表';
/*!40101 SET character_set_client = @saved_cs_client */;

