--
-- Table structure for table `cg_list`
--

DROP TABLE IF EXISTS `cg_list`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `cg_list` (
  `id` varchar(64) NOT NULL COMMENT 'ID',
  `name` varchar(50) NOT NULL COMMENT '名称',
  `path` varchar(45) NOT NULL DEFAULT 'list' COMMENT '路径最后一级',
  `table_id` varchar(32) NOT NULL COMMENT '对应表单',
  `icon` varchar(45) DEFAULT NULL COMMENT '图标',
  `head_title` varchar(64) NOT NULL COMMENT '列表标题',
  `tag_title` varchar(45) DEFAULT NULL COMMENT 'tag标题',
  `edit_inline` tinyint(1) NOT NULL COMMENT '行内编辑',
  `detail_inline` tinyint(1) NOT NULL COMMENT '行内详情',
  `sons` varchar(100) DEFAULT NULL COMMENT '子表',
  `son_fields` varchar(100) DEFAULT NULL COMMENT '子表外键字段列表',
  `son_align` varchar(1) NOT NULL DEFAULT 'v' COMMENT '主从表排列',
  `generator_type` int(11) NOT NULL COMMENT '主表宽度',
  `title_field` varchar(45) DEFAULT NULL COMMENT '显示在子表标题里的主表字段',
  `parent_entity` varchar(45) DEFAULT NULL COMMENT 'tree的父级Entity',
  `tree_show_entity` varchar(45) DEFAULT NULL COMMENT '树显示Entity',
  `show_search` tinyint(1) NOT NULL COMMENT '显示模糊查询',
  `toolbar_mode` int(11) NOT NULL DEFAULT '2' COMMENT '工具条显示模式',
  `table_height` int(11) NOT NULL DEFAULT '0' COMMENT '表高',
  `pagination` tinyint(1) NOT NULL COMMENT '是否分页',
  `order_by` varchar(100) DEFAULT NULL COMMENT '默认排序',
  `sort_field` varchar(45) DEFAULT NULL COMMENT '拖拽排序字段',
  `stripe` tinyint(1) NOT NULL DEFAULT '1' COMMENT '斑马纹风格',
  `border` tinyint(1) NOT NULL DEFAULT '0' COMMENT '边框',
  `state_entity` varchar(45) DEFAULT NULL COMMENT '状态字段或函数',
  `max_height` int(11) DEFAULT '0' COMMENT '最大高度',
  `highlight_current_row` tinyint(1) NOT NULL DEFAULT '1' COMMENT '单选高亮',
  `multiple` tinyint(1) NOT NULL DEFAULT '0' COMMENT '多选',
  `show_summary` tinyint(1) DEFAULT '0' COMMENT '统计栏',
  `span_entities` varchar(200) DEFAULT NULL COMMENT '合并字段',
  `show_header` tinyint(1) NOT NULL DEFAULT '1' COMMENT '显示表头',
  `images` varchar(200) DEFAULT NULL COMMENT '顶部轮播图像',
  `view_properties` text COMMENT '视图属性',
  `table_properties` text COMMENT '列表属性',
  `sons_properties` text COMMENT '子组件属性',
  `action_list` varchar(200) DEFAULT NULL COMMENT '功能清单',
  `flow_data_url` varchar(200) DEFAULT NULL COMMENT '流程状态数据url',
  `local_export` tinyint(1) NOT NULL DEFAULT '0' COMMENT '本地导出',
  PRIMARY KEY (`id`),
  UNIQUE KEY `ui_cg_list01` (`path`,`table_id`),
  KEY `fk_cg_list_table_id_cg_table_id` (`table_id`),
  CONSTRAINT `fk_cg_list_table_id_cg_table_id` FOREIGN KEY (`table_id`) REFERENCES `cg_table` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='列表视图定义';
/*!40101 SET character_set_client = @saved_cs_client */;

